const TokenList = () => {
  return (
    <div>

      Modal
      보유한 토큰 목록, 양
      토큰 추가
      <Box sx={{ p: 3 }}>
				<Stack spacing={3} direction="column" justifyContent="center" alignItems="center">
          <Typography>Token List</Typography>
        </Stack>
      </Box>
    </div>
  );
};

export default TokenList;
